import {useState, useEffect} from 'react'

const MemberComp = (props) =>
{
  const [member, setMember] = useState({})

  useEffect(async () =>
  {
    setMember(props.member);

  },[props])

  return(<div style={{width:"300px", height : "250px", borderWidth : "5px", borderStyle : "solid", borderColor : "blue"}}>
        
        Name : {member.Name} <br/> <br/>

        <img width = "140px" height = "200px" src={member.Image} />


      </div>)
}



export default MemberComp;
